:root {
  --bg: #121212;
  --fg: #d0d0d0;
  --tile: #e5e5e5;
  --tile-hover: #d6d6d6;
  --border: #2a2a2a;
}
* { box-sizing: border-box; }
body {
  margin: 10px;
  background: var(--bg);
  color: var(--fg);
  font-family: system-ui, -apple-system, Segoe UI, Roboto, Ubuntu, "Noto Sans", Arial, sans-serif;
}
.wrap {
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(40px, 1fr));
  gap: 6px;
}
.cell {
  display: flex;
  align-items: center;
  justify-content: center;
  height: 44px;
  border: 1px solid var(--border);
  border-radius: 8px;
  background: var(--tile);
  cursor: pointer;
  padding: 0;
  outline: none;
}
.cell:hover { background: var(--tile-hover); }
.cell:active { filter: brightness(0.95); }
.glyph {
  font-family: "CozetteMap";
  font-size: 24px;
  line-height: 1;
  color: #000;
}
.header {
  margin: 0 0 10px 0;
  font-size: 12px;
  color: #9aa0a6;
}
</style>

<script>
async function copy(txt) {
  try { await navigator.clipboard.writeText(txt); }
  catch(e) {
    const ta = document.createElement('textarea');
    ta.value = txt; document.body.appendChild(ta);
    ta.select(); document.execCommand('copy'); ta.remove();
  }
}
function copyCP(cp) {
  copy(String.fromCodePoint(cp));
}
</script>
